import Link from 'next/link';
const Home = () => (
	<div>
		<ul>
			<li><Link href="/login"><a>Login</a></Link></li>
			<li><Link href="/signup"><a>Signup</a></Link></li>
		</ul>
		<h5>Welcome to weather app</h5>
		<style jsx>{`
			ul {
				background: #333;
			}
			ul li {
				display: inline-block;
				font-size: 18px;
				list-style: none;
			}
			ul li a {
				color: white;
				text-decoration: none;
			}
		`}
		</style>
	</div>
)

export default Home;
